	[7151] = "{id = 7151, NameZh = '伊达秀明', ShowName = 2, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'NPC', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'M', Body = 1314, Gender = 1, BodyDefaultColor = 0, Hair = 5, HeadDefaultColor = 9, VisitVocal = '', EndVocal = '', Icon = 'SakuraBoy2', AdventureSort = 375, AdventureValue = 45, AdventureReward = {item = {{110, 5}}}, Condition = 5, Desc = '出生于天水之国的巫师家族，伊达秀明从小就有超越常人的灵能。他能看见鬼魂，甚至掌控鬼魂，这些能力也导致了他从小就被普通人孤立。一次偶然的机会，他遇见了同样无法被常人看见的灵——小樱，两个命运相同的人产生了心心相惜的感情。又在漫长的岁月里，这股微妙的情愫转变为了爱意，他爱上了小樱。而好景不长，上天没有给他们相守的机会，当命运之轮开始旋转时无人能抵挡悲剧的降临。', MoveSpdRate = 1, SpawnSE = '', DefaultDialog = 56173, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 1, move = 0, AccessRange = 2, Emoji = 0, Action = 9, Scale = 1.1, LoadShowPose = _EmptyTable}",
