	[7153] = "{id = 7153, NameZh = '伊达千代子', ShowName = 2, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'NPC', Race = 'DemiHuman', Nature = 'Neutral', Shape = 'M', Body = 1310, Gender = 2, BodyDefaultColor = 0, Hair = 31, HeadDefaultColor = 3, VisitVocal = '', EndVocal = '', Icon = 'ShrineSorceress2', AdventureSort = 376, AdventureValue = 45, AdventureReward = {item = {{110, 5}}}, Condition = 5, Desc = '天水之国巫女家族伊达的继承人，也是目前神社的掌管人。外表精灵古怪的千代子实际上有一颗脆弱的心。她身为伊达家族的继承人，巫术的实力却逊于自己的弟弟秀明，广受家族长辈责备。她将自己的痛苦藏在一张没心没肺的脸下，却一直默默关心着天水之国的安危，还有自己的弟弟秀明。', MoveSpdRate = 1, SpawnSE = '', DefaultDialog = 57272, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 1, move = 0, AccessRange = 2, Emoji = 0, Action = 9, Scale = 1.1, LoadShowPose = _EmptyTable}",
