	[8310] = "{id = 8310, NameZh = '波利', ShowName = 0, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'CatchNpc', Race = 'Plant', Nature = 'Water', Shape = 'M', Body = 10001, BodyDefaultColor = 0, VisitVocal = '', EndVocal = '', Icon = 'boli', AdventureReward = _EmptyTable, Desc = 'RO中的超人气魔物，以其卡哇伊的造型风靡万千玩家，风头直超同胞波波利甚多。非常喜欢苹果，会跟着给它苹果的人们，也会去捡拾各类掉落的道具。能力最弱，是人见人欺的对象，适合初心者练级。', Level = 1, MoveSpdRate = 2, SpawnSE = '', DefaultDialog = 53175, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 0, move = 0, AccessRange = 2, Emoji = 0, Action = 0, LoadShowPose = _EmptyTable}",
	[8311] = "{id = 8311, NameZh = '小野猪', ShowName = 0, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'CatchNpc', Race = 'Brute', Nature = 'Earth', Shape = 'L', Body = 10156, BodyDefaultColor = 0, VisitVocal = '', EndVocal = '', Icon = 'Savage', AdventureReward = _EmptyTable, Desc = '杂食性动物，体躯健壮，四肢粗短，有厚实的鬃毛和尖锐的獠牙。虽然是猪，但肉很结实，体魄绝对强健。如果不幸将其惹恼，那对致命的獠牙可会让敌人吃不了兜着走！', Level = 1, MoveSpdRate = 1, SpawnSE = '', DefaultDialog = 53175, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 0, move = 0, AccessRange = 2, Emoji = 0, Action = 0, LoadShowPose = _EmptyTable}",
	[8312] = "{id = 8312, NameZh = '溜溜猴', ShowName = 0, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'CatchNpc', Race = 'Brute', Nature = 'Earth', Shape = 'S', Body = 10013, BodyDefaultColor = 0, VisitVocal = '', EndVocal = '', Icon = 'Yoyo', AdventureReward = _EmptyTable, Desc = '动作快，也很会捡拾道具。虽然很可爱，但是有点烦人。调皮捣蛋的天性让人又爱又恨，尤其是吃完香蕉随意丢香蕉皮的陋习难改，上次国王出行还滑过一跤……', Level = 1, MoveSpdRate = 3.2, SpawnSE = '', DefaultDialog = 53175, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 0, move = 0, AccessRange = 2, Emoji = 0, Action = 0, LoadShowPose = _EmptyTable}",
	[8313] = "{id = 8313, NameZh = '沙漠幼狼', ShowName = 0, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'CatchNpc', Race = 'Brute', Nature = 'Fire', Shape = 'M', Body = 10080, BodyDefaultColor = 0, VisitVocal = '', EndVocal = '', Icon = 'DesertWolf', AdventureReward = _EmptyTable, Desc = '在沙漠生存下来的狼，有比一般狼更强的攻击力，并会主动攻击敌人。适者生存，大自然就是那么残酷。别看其眼睛小，说不定正在狡黠地在打目标的主意呢…', Level = 1, MoveSpdRate = 1.4, SpawnSE = '', DefaultDialog = 53175, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 0, move = 0, AccessRange = 2, Emoji = 0, Action = 0, Scale = 1.6, LoadShowPose = _EmptyTable}",
	[8314] = "{id = 8314, NameZh = '曼陀罗种子', ShowName = 0, Guild = '', GuildEmblem = '', MapIcon = '', AtlasOpt = '', Position = '', Type = 'CatchNpc', Race = 'Plant', Nature = 'Earth', Shape = 'S', Body = 10122, BodyDefaultColor = 0, VisitVocal = '', EndVocal = '', Icon = 'Mandala', AdventureReward = _EmptyTable, Desc = '迷之植物，个子不大，天性羞涩，擅长捉迷藏。据说只有在迷藏森林服用一种特殊的药水来提升第六感后才能够发现它们。作为种子，萌萌的，遭人怜爱…', Level = 1, MoveSpdRate = 1, SpawnSE = '', DefaultDialog = 53175, NpcFunction = _EmptyTable, RequireNpcFunction = _EmptyTable, FnIcon = '', FnDesc = '', IsVeer = 0, move = 0, AccessRange = 2, Emoji = 0, Action = 0, LoadShowPose = _EmptyTable}",
